@Raja Muhd Hafiz Raja Kamarudin That's a fair approach and a lot of people do that. But as an enthusiast on a budget, I prefer options that allow me to tinker with my system longer without going through a full platform upgrade.

For example, right now I could afford 7600X. In 6 months from now I can sell it and get a secondhand 7700X or even 7900X. 

CPU performance between generations was very stale during 2010s, but with AMD making a massive comeback in recent years and things getting competitive with Intel, the performance gains have become increasingly more impressive as well. For people like me this gives more incentive to upgrade during a single generation.

@RiceCube Tech pretty sure he is talking about Threadripper. TR4 only lasted for 1st and 2nd gen Threadripper, while sTRX4 was only compatible with 3rd gen. Anyone who bought into those platforms with the idea of having an upgrade path later, is completely screwed.

Now i don't think they'll abandon AM5 before 2025, but note that that's barely more than a 2 year commitment given the platform launched late 2022. They're not actually promising that much. If they release another generation early 2024 and break compatibility with the next in early 2026, they're technically not breaking their promise.

Like always: buy what gives you value right now. Don't buy a promise. Upgrading on AM4 was really nice because early Ryzen kinda sucked. With these CPUs, odds are you aren't upgrading until the next socket anyway...

@Daniel Warner techtubers rarely verify long term stability issues. For one example, older AM4 tend to have cold boot loops when dropping in a new zen2 and 3 cpu (one that is not noticeable unless viewed in event logs) but it has the tendency to corrupt system files. 

There are alot of other issues too albeit most are small gremlins. after all the bios were "beta" for older boards provided upon board maker's decision and it's to be used at own risk.

That said, if zen5 is really big little arch as leaked. I would expect x670 to properly last 1 gen only.

@Corey DRIZZLE yes you're right, a lambo owner doesn't care abt MPG, but if I were to buy two supercars, with ~the same HP, same 0-100/0-60 times, and both looking great, if everything else is very similar, looking at MPG would be a key factor in deciding which car I want to have
also, unlike buying a Lambo, you don't need to be rich-rich to afford a high end PC, which means some people still care abt the efficiency
it's more important than you might think, not only bcs your electricity bill will be lower, but also a more effcient cpu usually runs cooler, therefore has a longer life expectancy

@Alexandru Ilea Adding onto that, I'd argue that going from "My Gf's rig" to "Their (her families) PC" makes perfect sense. You don't need to identify who owns "The PC" in the first comment, just give your link to "The PC."
IE: He just needed to explain why he knew about the PC, not identify all of its owners, to get the point across.
Following that: He needed to use "The PC" as a noun, and to differentiate it from any other "PC", so he would then need to reference the owners of "The PC", who happened to be the family of the Gf. So his sentence checks out anyways. (OBV to use The PC as a Noun you just do it, so the only real part we needed to worry about is the 'Differentiation bit').

