@666Tomato666 Of course. It's a consideration, not a reason not to buy a good computer. If you're getting your performance targets though/have an idea of the power levels you want to hit you can optimize for both fun and finances. I'm not buying a 450 watt GPU. I don't even like buying a 300 watt GPU. I've gamed on an rx 460, an rx 580, and a reference 5700XT and they all did their service when I needed them to with sufficiently reasonable power budgets.

My target is still going to be ultrawide 1440p 160ish FPS, so I'm also not going to need a 7900XTX or even a 4080. I'm not going to need nor want a 7950 or a 13900K. I'm even going to be able to justify a fully passive build most likely when whatever the radeon 7600/7700 is and the 7800X3D come out, most likely, and the lowered comparative power costs and part costs will justify grabbing The Beast or whatever is the most appropriate fully passive case at that time, for example.

There's no need to compromise, but there's also no need to compromise, basically.

