@dan537 What are you on about? I was just stating my power draw concerns. 
Do I spend less now and pay more in the long run since my gear is always at near full load or do I spend more and get gear that isn't full load and potentially more efficient at lower speeds? Power supplies for example have the efficiency curve and running it at around 60% load is the most efficient option. 
I never mentioned Intel or AMD.

