BTW: Electricity (and gas) is so expensive because of russia. We had most of our regular electricity generated by burning gas and gas prices went through the roof, many electricity companies bought the (in some cases) 50x more expensive gas and now they generate electricity from that and because of some stupid eu regulations the electricity price is bound to the costs to generate electricity from gas. Because of that even electricity from renewables aren't that cheap.
But hey, at least we can get electricity and gas and if I want t play a game I only need to pay for elctricity and not gas, thanks to my 3080 and 12900k.

