@Gaston Zamora Encoding is something that could easily be overturned in a single generation. CUDA workloads however.. yeah, CUDA is CUDA and AMD doesn't have it (and can't have it since it's a NVIDIA proprietary technology). 

It'll likely be the same story as the RTX 3000 series vs the RX 6000 series. Pretty close across the board with lower power draw and much better price to performance for AMD, but for the absolutely highest performance (and power draw!) NVIDIA remains on top, even more so when it comes to raytracing. This time around people (even the bigger NVIDIA fans) actually seem to (finally) be fed up with NVIDIA's insane pricing which is interesting as AMD seems to be planning on gaining marketshare (whilst still charging too much, but not as much as NVIDIA) instead of going for completely insane prices.

Interesting times, I'll just stand on the side-line and see if there's any used market deals because I'm not going along with this crazy pricing scheme that's been happening ever since the RTX 2000 series on both sides.
